    "2013-03-14T19:31:34.907865",nt"name": "fisheries-restoration-grant-program-projects-ds168",nt"isopen":
    false,nt"url": null,nt"notes": "This shapefile (FRGP_All_020209.shp) represents
    the locations of all ongoing and completed salmonid restoration projects in California
    with existing records in the California Habitat Restoration Project Database (CHRPD).
    The CHRPD was created in 1999 to capture and maintain data about habitat restoration
    projects in California benefiting anadromous fish. The CHRPD is managed and supported
    by the Pacific States Marine Fisheries Commission (PSMFC) and California Department
    of Fish and Game (CDFG), and funded by NOAA Fisheries and CDFG. Project locations
    are digitized in as much detail as possible based on the contractors' maps. The
    All_Points_081508_FRGP_CalFish.shp shapefile represents the centerpoint of individual
    project sites of a completed or ongoing restoration project in the California Habitat
    Restoration Project Database as of February 2009. Many of the projects have multiple
    sites.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
